import './App.css';
import {getAllPackages, postPackage, putPackage, deletePackage} from './services/travelagentServices/packageService'


function App() {
  const fetchFestivals = async() => {
    try{
      const response = await postPackage({
        "packageName": "string",
        "packageType": "string",
        "packageDescription": "string",
        "placeCount": 0,
        "packagePrice": 0,
        "packageImgURL": "string"
      });
      console.log(response)
    }
    catch(error){
      console.log(error)
    }
  }
  return (
    <div className="App">
      <button onClick={fetchFestivals}>get</button>
    </div>
  );
}

export default App;
